import './homepage.styles.css';
 

class homepage extends Component {
  
  render() {
    return ( 
      
          <div className="bgHomeimg text-white hearderset">
            <h2>WELCOME TO RETAILCLICK ONLINE </h2>
            <h3>Smart people choose RetailClick</h3>
            <Home></Home>
       <Features></Features>
       <About></About>
       <RFID></RFID>
       <Customised></Customised>
       <MobileApp></MobileApp>
       <WeOffer></WeOffer>
          </div>

      
     
    );
  }
}

export default homepage;
